import React from 'react';

const ServiceTitle = ({ logo, title, isLeftAligned }) => {
  const titleClass = isLeftAligned ? 'service-title-container-left' : 'service-title-container';
  const logoClass = isLeftAligned ? 'service-logo-container-right' : 'service-logo-container';

  return (
    <div className={titleClass}>
      <div className={logoClass}>
        <img src={logo} alt="Logo" className="service-logo" />
      </div>
      <div>
        <h1>{title}</h1>
      </div>
    </div>
  );
};

export default ServiceTitle;
